5767.informacaoComplementar:
1- Na impossibilidade de acessar a documentação pelo sistema compras.gov.br, as empresas interessadas no Credenciamento deverão verificar a documentação relativa ao Edital e seus anexos no site do Serviço de Assistência Social da Marinha (SASM): https://www.marinha.mil.br/sasm/;

2- Os valores a serem pagos por cada modalidade de atendimento constam do Apêndice I do Anexo A do Edital - Tabela de Preços por Regime de Atendimento;

3- As empresas deverão preencher a Carta-Proposta (ANEXO C do Edital)  e verificar RIGOROSAMENTE todos os documentos: alguns serão inseridos no SICAF e outros enviados para o e-mail sasm.licitacao@marinha.mil.br (na impossibilidade de inserir no sistema compras.gov.br); e

4- O valor global do credenciamento é meramente estimativo, considerando a quantidade de empresas a serem credenciadas e o histórico de atendimentos em contratos anteriores, refletindo o cálculo pelo período de 05 anos (vigência do Edital).
